export default function DiscountsElemen(props: DiscountsRateProps) {
  const {name, discount_rate} = props;
  return (
    <div>
    <input type="checkbox" />
    <span>{name}</span>
    <button type="button">메뉴 선택</button>
    </div>
  )
}
